import React from 'react';
import { StyleSheet, View } from 'react-native';
// import Svg, { Circle, Path } from 'react-native-svg/lib/typescript/elements';
import Svg, { Circle, G, Image, Path } from 'react-native-svg';

const FemaleChar = () => {
  return (
    <View style={styles.container}>
      <Svg
        xmlns="http://www.w3.org/2000/svg"
        xmlnsXlink="http://www.w3.org/1999/xlink"
        width={100}
        height={100}
        viewBox="0 0 1179 1200"
      >
        <Image
          xlinkHref="data:img/png;base64,"
          width={1179}
          height={1200}
        />
      </Svg>
    </View>
  );
};

export default FemaleChar;

const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
    borderRadius: '100',
  },
});
